import styled from 'styled-components'
import Taskbar from './Taskbar.js';
import Header from './Header.js';

const Profile = () => {
    return (
        <>
        <Header />
        <Taskbar />
        </>
    )
}

export default Profile

const Container = styled.div`
    width: 50%;
    height: 100%;
    min-height: 600px;
    margin: 0;
    padding: 0;
    background-color: #8ECAE6;
`
